irm:{body:"Mensaje",subject:"Asunto"},awaiting_approval:{body:"Hola %{user},<br/><br/> \n¡Gracias por registrarte en %{account}!<br/><br/> \nTu cuenta está pendiente de aprobación. \n",subject:"Tu registro en %{account} está pendiente de aprobación"},billed:{body:"Hola %{user},<br/><br/>\nTu pago se realizó en %{date}<br/>\nEste pago cubre los gastos por %{account} en %{site_url}<br/><br/>\nEl total de la factura fue: $ %{amount} USD <br/><br/>\nPara tu contabilización, la factura se adjunta como un archivo PDF.<br/><br/> \nSiéntete libre para ir a la configuración de tu cuenta si deseas cambiar tus datos de pago.<br/><br/>\n¡Nuestro equipo está aquí para ayudar siempre que lo necesites! Puedes contactarnos a support@modyo.com. <br/><br/>\nGracias de nuevo.<br/><br/>\nEl Equipo Modyo <br/> \n",subject:"Has pagado exitosamente. Muchas gracias."},payment_failed:{body:"Hola %{user},<br/><br/>\nEstamos teniendo problemas para procesar tu pago.<br/>\nEste pago cubre los gastos por %{account} en %{site_url}<br/><br/>\nSiéntate libre para ir a la configuración de tu cuenta si deseas revisar o cambiar tu tarjeta de crédito.<br/><br/>\n¡Nuestro equipo está aquí para ayudar siempre que lo necesites! Puedes contactarnos a support@modyo.com.<br/><br/>\nGracias de nuevo.<br/><br/>\nEl Equipo Modyo<br/> \n",subject:"No hemos podido procesar tu pago."},error:{body:"Estimado Cliente Modyo, <br/><br/> \nHubo un problema con tu cuenta ( %{account} ). No hemos podido cargar tu tarjeta de crédito por la cantidad de $ %{amount} el %{date} . Vamos a tratar de cobrar esta cantidad nuevamente. Si tenemos problemas, su cuenta puede ser suspendida Modyo. <br/><br/>\n\nSi deseas pagar con una tarjeta de crédito diferente, puedes hacerlo dirigiéndote a: %{site_url}/admin/billing/edit<br/><br/>\n\nNuestro equipo está aquí para ayudarte. Por favor, no dudes en contactarnos a support@modyo.com si tienes alguna pregunta<br/><br/> \n\nGracias nuevamente. <br/>\nAtentamente,<br/>\nEl Equipo Modyo. <br/>\n",subject:"Hay problemas con tu cuenta de Modyo - Por favor leer."},recover:{body:"Hola %{user},<br/><br/>\nSe ha realizado una solicitud para restablecer tu contraseña.<br/>\nSi tu no has realizado la solicitud, simplemente ignora este mensaje.<br/>\nSi tú realizaste esta solicitud, has click en el enlace de abajo:<br/><br/> \n%{link} <br/> <br/> \nSi la URL anterior no funciona, intenta copiarla y pegarla en tu navegador.\n",subject:"Restablecer tu contraseña"},imported_user_account:{body:"Hola %{user} , <br/><br/>\nAlguien en %{account} creó una cuenta especialmente para tí. <br/> Necesitamos que confirmes algunos datos y crees una contraseña para tu cuenta. Por favor, haz clic en el enlace de abajo: <br/>\n\n%{link} <br/> <br/>\n\n El equipo %{account} <br/>\n",subject:"Una cuenta se ha creado para ti"},trial_period:{body:"Hola %{user},<br/><br/>\n\nGracias por probar la cuenta de %{trial} días de prueba de Modyo Developer Edition. Modyo es una poderosa plataforma de desarrollo web, utilizada por grandes compañías para construir sitios que hacen clientes felices. <br/><br/>\nModyo potencia tu propia nube privada para construir y desplegar sitios con gestión de contenidos empresariales, grandes herramientas, una base de datos integrada de clientes, email marketing y análisis en un solo lugar. También puedes actualizar tu cuenta en cualquier momento para agregar más aplicaciones en nuestra Enterprise Edition.<br/><br/>\n\nLa información de tu cuenta es: <br/><br/>\n\nURL: %{site_url} <br/>\nTrial expira el: %{expiry_date} .<br/><br/>\n\nLo más probable es que alguien del equipo de Modyo trate de saludarte e intente darte una mano. Mientras tanto, no dudes en contactarnos a support@modyo.com.<br/><br/>\nDisfrute de la prueba.<br/><br/>\nEl Equipo Modyo\n",subject:"Bienvenido a Modyo"},pending_trial_period:{subject:"Bienvenido a Modyo: Cuenta de prueba pendiente de autorización",body:"Hola %{user},<br/><br/>\nLa cuenta %{account} en %{site_url} se ha creado correctamente, pero necesita ser autorizada por nuestro equipo de producto de Modyo.<br/>\nAsí que relájate, ten un poco de paciencia y te enviaremos dentro de poco un correo electrónico cuando la cuenta esté lista. Esto no debería tomar mucho tiempo.<br/><br/>\nMientras tanto, si estás en un apuro, no dudes en contactarnos a support@modyo.com.<br/><br/>\nDisfrute de la prueba.<br/><br/>\nEl Equipo Modyo\n"},scheduled_close:{body:"Hola %{user},<br/><br/>\nEl %{date}, tristemente nos solicitaste cerrar tu cuenta %{account} en %{site_url} <br/>\nHemos programado el cierre para el final del período de facturación actual, el %{close_date}<br/><br/>\nSi no deseas bajar tu sitio, sólo tienes que ir a la configuración de tu cuenta y cancelar lo que has hecho.<br/><br/>\nNuestro equipo está aquí para ayudar siempre que lo necesites! Puedes contactarnos a support@modyo.com.<br/><br/>\nGracias de nuevo.<br/><br/>\nEl Equipo Modyo <br/> \n",subject:"No te preocupes .... Recibimos tu solicitud de cierre de cuenta."},closed:{body:"Hola %{user},<br/><br/>\nEl %{date}, tu cuenta %{account} en %{site_url} ha sido desactivada<br/> \n¡Nuestro equipo está aquí para ayudar siempre que lo necesites! Puede contactarnos a support@modyo.com.<br/><br/>\nGracias de nuevo.<br/><br/>\nEl Equipo Modyo <br/> \n",subject:"Tu cuenta ha sido desactivada oficialmente"},expiring_trial:{body:"Hola %{user},<br/><br/>\nTu cuenta de prueba de Modyo está a punto de decir sayonara.<br/><br/> \nAsí que si te gusta lo que ves, inicia sesión en %{site_url} antes de %{expire_date}.<br/>\nEn %{site_url}/plan puedes seleccionar el plan más adecuado para tí.<br/><br/>\nNuestro equipo está por lo general siempre conectado, así que puedes enviarnos un correo electrónico a support@modyo.com.<br/><br/>\nGracias,<br/><br/>\nEl Equipo Modyo\n",subject:"Tu cuenta de prueba Modyo está a punto de expirar."},expired_trial:{body:"Hola %{user},<br/><br/>\nGracias por probar Modyo. Lamentablemente, no pudimos convencerte a dar el salto todavía. Así que... pondremos a descansar a tu cuenta.<br/><br/>\nRIP %{site_url} <br/>\nNacido %{created_at} <br/>\nDescansando en paz %{current_date}<br/><br/>\nSin embargo, ¡puedes traer de vuelta a la vida %{site_url} si actualizas a un plan hoy! <br/><br/> \nSolo ingresa y dentro de %{site_url} haz click en Upgrade para activar tu cuenta en Modyo.<br/><br/>\n¡Siempre estamos aquí!  Así envíanos un correo a support@modyo.com. <br/><br/>\nEl Equipo Modyo\n",subject:"Lamentablemente, tu cuenta de prueba Modyo expiró. Pero no te preocupes ..."},suspended:{body:"Hola %{user},<br/><br/>\nEl %{date} , tu cuenta %{account} en %{site_url} fue suspendida.<br/><br/>\nEn %{site_url} encontrarás instrucciones para activar tu cuenta Modyo nuevamente.<br/><br/>\n¡Siempre estamos aquí! Así envíanos un email a support@modyo.com<br/><br/>\nEl Equipo Modyo <br/>\n",subject:"Uffff ... Tu cuenta en Modyo ha sido suspendida"},blocked:{body:"Hola %{user},<br/><br/>\nPor desgracia, hemos detectado contenido o acciones en tu cuenta que parecen violar nuestros términos de servicio. Como resultado, en %{date} , tu cuenta %{account} %{site_url} fue bloqueada hasta que entendamos la situación.<br/><br/>\nSin embargo, ¡siempre estamos aquí! Así que puedes enviarnos un email a support@modyo.com.<br/><br/>\nEl Equipo Modyo <br/>\n",subject:"Uffff ... Tu cuenta en Modyo fue bloqueada"},reactivated:{body:"Hola %{user},<br/><br/>\nEn %{date}, tu cuenta %{account} en %{site_url} se reactivó.<br/><br/>\n¡Siempre estamos aquí! Así puedes enviarnos un email a support@modyo.com.<br/><br/>\nEl Equipo Modyo<br/>\n",subject:"Ahora estamos hablando ... tu cuenta en Modyo ha sido reactivada"},added_by_admin:{body:"Hola %{user_name},<br/><br/>\nAlguien en %{account_name} ha creado una cuenta especialmente para tí.<br/><br/>\nUrl: %{account_url} <br/>\nEmail: %{user_email}<br/>\nContraseña: %{user_password}<br/><br/>\nEl Equipo %{account_name} <br/>\n",subject:"Una cuenta se ha creado para ti"},for